import {
    Box,
    Container,
    Image,
    Button,
    Checkbox,
    Flex,
    FormControl,
    FormLabel,
    FormErrorMessage,
    Input,
    VStack
  } from "@chakra-ui/react";
import logo from "../common/logo.svg";

const Header =() => {
    return (
        <Box as="header">
            <Container maxW="container.lg" >
                <Flex>
                    <Image src={logo} />
                </Flex>
            </Container>
        </Box>
    )
}

export default Header;
